import Footer from 'components/common/Footer';
import TopBanner from 'components/common/TopBanner';
import GridArticle from 'pages/home/GridArticle';
import React, { useEffect, useState } from 'react';
import styled from 'styled-components';
import { CustomGet } from 'utils/api';

function JobsfeedPage() {
	const [topBannerData, setTopBannerData] = useState(null);

	useEffect(() => {
		const topbanner = CustomGet({
			url: 'web/home/advertisments',
		});
		topbanner.then((res) => {
			switch (res.code) {
				case 1005:
					setTopBannerData(res.result);
					break;
				default:
			}
		});
	}, []);
	return (
		<ComponentsWrapper>
			<TopBanner data={topBannerData} />
			<section className="section">
				<div className="box-section-wrapper">
					<GridArticle2 />
				</div>
			</section>
			<Footer />
		</ComponentsWrapper>
	);
}

const BnnaerCreatApplication = styled.div`
	display: flex;
	height: 110px;
	background-color: #36f;
	a {
		width: 220px;
		height: 40px;
		font-size: 15px;
		color: #36f;
		background-color: #fff;
		border: 1px solid #36f;
		position: relative;
		display: -ms-inline-flexbox;
		display: inline-flex;
		-ms-flex-align: center;
		align-items: center;
		-ms-flex-pack: center;
		justify-content: center;
		vertical-align: middle;
		min-width: 64px;
		padding: 0 27px;
		-webkit-box-sizing: border-box;
		box-sizing: border-box;
		border-radius: 25px;
		font-size: 16px;
		font-weight: 700;
		line-height: normal;
		cursor: pointer;
	}

	.banner-creatapplication-content {
		font-size: 24px;
		color: #fff;
		font-weight: 500;
		line-height: 35px;
		letter-spacing: -0.2px;
		align-self: auto;
		flex-wrap: nowrap;
		align-items: flex-start;
		justify-content: flex-start;
		flex-direction: row;
		box-sizing: border-box;
		> span {
			color: #a9ecf0;
		}
	}
	.banner-creatapplication-imgwrapper {
		flex-grow: 1;
		align-self: auto;
		flex-wrap: nowrap;
		align-items: flex-start;
		justify-content: flex-start;
		flex-direction: row;
		box-sizing: border-box;
		margin: 0;
	}
`;

const ComponentsWrapper = styled.main`
	padding-top: 25px;

	.section {
		position: relative;
		scroll-margin-top: 4px;
		padding: 60px 0;
	}
	.box-section-wrapper {
		max-width: 1060px;
		width: 87.72%;
		/* width: 1060px; */
		margin: 0 auto;
	}
	.banner-container {
		max-width: 1060px;
		width: 87.72%;
		margin: 0 auto;
		display: flex;
		flex-direction: row;
		align-self: auto;
		flex-wrap: nowrap;
		align-items: center;
		justify-content: flex-start;
	}
	.linebanner {
		margin-top: 0 !important;
		margin: 60px auto 0;
	}
	.linebanner-gradient {
		background-image: linear-gradient(
			90deg,
			#01a9fe -12%,
			#2f5fef 37%,
			#046afe 72%,
			#00d2dd 110%
		);
		padding: 21px 30px;
		font-size: 17px;
		border-radius: 38.5px;
		line-height: normal;
		display: flex;
		flex-grow: 1;
		justify-content: center;
		align-items: center;
		color: #fff;
		font-weight: 700;

		.icon-svg-wrapper {
			display: inline-flex !important;
			width: 10px !important;
			margin-left: 2px !important;
			vertical-align: text-top !important;
		}
	}
`;
export default JobsfeedPage;
